const today = new Date();
const last24Hours = new Date(today.getTime() - 24 * 60 * 60 * 1000);

document.addEventListener("DOMContentLoaded", () => {
    const districtSelect = document.getElementById('district-select');
    const uniqueDistricts = [...new Set(data.map(item => item.District))];
    
    // Populate dropdown with unique districts
    uniqueDistricts.forEach(district => {
        const option = document.createElement('option');
        option.value = district;
        option.textContent = district;
        districtSelect.appendChild(option);
    });

    // Event listener for dropdown change
    districtSelect.addEventListener('change', () => {
        const selectedDistrict = districtSelect.value;
        updateChart(selectedDistrict);
    });

    // Initialize the chart with the first district as default
    if (uniqueDistricts.length > 0) {
        updateChart(uniqueDistricts[0]);
    }
});

// Function to filter data and update chart
function updateChart(selectedDistrict) {
    const filteredData = data
        .filter(item => 
            new Date(`${item.date} ${item.hour}`) >= last24Hours &&
            item.District === selectedDistrict
        )
        .map(item => ({ hour: item.hour, AQI: item.AQI }));
    
    const hoursArray = filteredData.map(item => item.hour);
    const aqiData = filteredData.map(item => item.AQI);

    // Remove existing chart if it exists
    const chartContainer = document.getElementById('chart-container');
    chartContainer.innerHTML = '<canvas id="line-chart"></canvas>';
    const ctx = document.getElementById('line-chart').getContext('2d');

    // Create new Chart instance
    new Chart(ctx, {
        type: 'line',
        data: {
            labels: hoursArray,
            datasets: [{
                label: 'Max AQI hourly',
                data: aqiData,
                borderColor: 'blue',
                borderWidth: 2,
                fill: false,
            }]
        },
        options: {
            responsive: true,
            plugins: {
                legend: {
                    display: true,
                    labels: {
                        color: 'blue'
                    }
                }
            },
            scales: {
                y: {
                    beginAtZero: true,
                    max: 1200 // Adjust as needed to match your AQI data range
                },
                x: {
                    title: {
                        display: true,
                        text: 'Time (Hours)'
                    }
                }
            }
        }
    });
}